The example uses derive(ToValue) and derive(FromValue) to create an enum and struct that can be used as parameters to ocaml::funcs. Their names will be converted to snake case for OCaml, so the Rust type BinOp will become bin_op and Expr will become expr. # extern crate ocaml; #[derive(ocaml::FromValue, ocaml::ToValue, Clone, Copy)]
#[ocaml::sig("Add | Sub | Mul | Div")]
pub enum BinOp { Add, Sub, Mul, Div
} #[derive(ocaml::FromValue, ocaml::ToValue)]
#[ocaml::sig("lhs: float; rhs: float; op: bin_op")]
pub struct Expr { lhs: f64, rhs: f64, op: BinOp,
} #[ocaml::func]
#[ocaml::sig("expr -> float")]
pub fn expr_eval(expr: Expr) -> f64 { match expr.op { BinOp::Add => expr.lhs + expr.rhs, BinOp::Sub => expr.lhs - expr.rhs, BinOp::Mul => expr.lhs * expr.rhs, BinOp::Div => expr.lhs / expr.rhs }
}

