This example shows how to call an OCaml function from Rust - the OCaml function must be registered using Callback.register . In this case we're calling the OCaml function my_incr, which looks like this: let my_incr x = x + 1
let () = Callback.register "my_incr" my_incr # extern crate ocaml; ocaml::import! { fn my_incr(x: ocaml::Int) -> ocaml::Int;
} #[ocaml::func]
#[ocaml::sig("int -> int")]
pub unsafe fn call_my_incr(x: ocaml::Int) -> Result<ocaml::Int, ocaml::Error> { my_incr(gc, x)
} A few things to note: When calling the import! ed function you will need to pass the OCaml runtime handle as the first parameter The return value of the function will be wrapped in Result<T, ocaml::Error> because the function may raise an exception For functions that aren't registered using Callback.register you can use the ocaml::function! macro to convert them into a typed closure: # extern crate ocaml; #[ocaml::func]
#[ocaml::sig("(int -> int) -> int -> int")]
pub unsafe fn call_incr(incr: ocaml::Value, a: ocaml::Int) -> Result<ocaml::Int, ocaml::Error> { let incr = ocaml::function!(incr, (a: ocaml::Int) -> ocaml::Int); incr(gc, &a)
}

