use ocaml::{ToValue}; #[ocaml::func]
#[ocaml::sig("string -> (int, [`Msg of string]) result")]
pub unsafe fn try_int_of_string(s: &str) -> Result<ocaml::Int, ocaml::Value> { match s.parse::<isize>() { Ok(i) => Ok(i), Err(e) => { let s = format!("{e:?}"); let err = ocaml::Value::hash_variant(gc, "Msg", Some(s.to_value(gc))); Err(err) } }
}

