The ToValue trait has a single function, to_value which takes a reference to self, a reference to [Runtime] and returns a Value and FromValue has from_value, which takes a Value and returns Self: # extern crate ocaml; pub struct MyType(i32); unsafe impl ocaml::ToValue for MyType { fn to_value(&self, _gc: &ocaml::Runtime) -> ocaml::Value { unsafe { ocaml::Value::int32(self.0) } }
} unsafe impl ocaml::FromValue for MyType { fn from_value(value: ocaml::Value) -> MyType { unsafe { MyType(value.int32_val()) } }
} This can also be accomplished using the derive macros: # extern crate ocaml; #[derive(ocaml::ToValue, ocaml::FromValue)]
pub struct MyType(i32); derive(ToValue, FromValue) will work on any struct or enum that are comprised of types that also implement ToValue and FromValue

