Rust values can be used as opaque values that can be shared with OCaml using ocaml::Pointer . The Pointer type allows for Rust values to be allocated using the OCaml runtime, this means their lifetime will be handled by the garbage collector. Pointer::alloc_final is used to move an existing Rust type into an OCaml allocated pointer, but even better is the option to implement the Custom trait for your type. Implementing Custom allows you to define equality/comparison, finalization, hashing and serialization functions for your type that will be used by OCaml. When allocating custom values you should use Pointer::from or Pointer::alloc_custom. In either case you will need to write the allocation function in Rust because OCaml doesn't know the specifics about the layout or contents of these types, unlike when using FromValue or ToValue. Pointer should primarily be used on Rust values that cannot be converted directly to OCaml types. # extern crate ocaml; #[ocaml::sig] // Creates an opaque type on the OCaml side
pub struct MyType { a: i32, b: f64, c: std::fs::File, // This can't be converted to an OCaml value
} ocaml::custom!(MyType); #[ocaml::func]
#[ocaml::sig("my_type -> float")]
pub unsafe fn my_type_add_a_b(t: &MyType) -> f64 { t.a as f64 + t.b
} NOTE: In this example the Rust type MyType has automatically been renamed to my_type in OCaml. Also in this example, the default finalizer is used - this will call Pointer::drop_in_place to call drop on the Rust side before freeing the memory on the OCaml heap. If you add your own finalize implementation you should make sure to call Pointer::drop_in_place any time the underlying Rust value contains dynamically allocated values, like std::fs::File in the example above. Now that you have some insight into how type conversion is handled, the next section will cover more details about writing OCaml functions in Rust.

